"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\" colspan=\"1\">",
"        Outcome",
"       </td>",
"       <td class=\"subtitle1\">",
"        Range reported in the literature, percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Chromosomal abnormalities",
"       </td>",
"       <td>",
"        4 to 25",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Fetal growth restriction*",
"       </td>",
"       <td>",
"        0 to 19",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Perinatal death*",
"       </td>",
"       <td>",
"        0 to 17",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Congenital infection",
"       </td>",
"       <td>",
"        0 to 10",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cystic fibrosis",
"       </td>",
"       <td>",
"        0 to 5",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Excludes chromosomally abnormal fetuses.",
