var title_f7_49_7965="Differential diagnosis acute knee pain athlete A";
var content_f7_49_7965=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F76993&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F76993&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Differential diagnosis of acute knee pain in the young athlete: part A",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Condition",
"       </td>",
"       <td class=\"subtitle1\">",
"        Mechanism of injury",
"       </td>",
"       <td class=\"subtitle1\">",
"        Clinical Features",
"       </td>",
"       <td class=\"subtitle1\">",
"        Comments",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\" rowspan=\"1\">",
"        Anterior",
"pain",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"1\" rowspan=\"5\">",
"        ACL injury",
"       </td>",
"       <td colspan=\"1\" rowspan=\"5\">",
"        Twisting or hyperextension",
"       </td>",
"       <td>",
"        Sudden pain and giving way",
"       </td>",
"       <td colspan=\"1\" rowspan=\"5\">",
"        Often accompanied by MCL and/or meniscal injury",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Unable to ambulate",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hemarthrosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Abnormal anterior drawer, Lachman, or pivot shift test",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Inability to fully squat or duck waddle",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"1\" rowspan=\"3\">",
"        Rupture of patellar",
"or quadriceps tendon",
"       </td>",
"       <td colspan=\"1\" rowspan=\"3\">",
"        Fall on partially flexed knee",
"       </td>",
"       <td>",
"        Instability with ambulation",
"       </td>",
"       <td colspan=\"1\" rowspan=\"3\">",
"        May be associated with patellar fracture",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Significant pain and swelling",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Large effusion",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\" rowspan=\"1\">",
"        Posterior pain",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"1\" rowspan=\"4\">",
"        PCL injury",
"       </td>",
"       <td colspan=\"1\" rowspan=\"4\">",
"        Direct force to anterior knee with the knee in flexion,",
"fall onto flexed knee with foot in plantar flexion; hyperflexion;",
"hyperextension (after rupture of ACL)",
"       </td>",
"       <td>",
"        Effusion within 24 hours",
"       </td>",
"       <td colspan=\"1\" rowspan=\"4\">",
"        Usually combined with other injuries",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Limited range of motion",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Instability",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Tibia in posterior position relative to femur",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\" rowspan=\"1\">",
"        Medial pain",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"1\" rowspan=\"4\">",
"        MCL injury",
"       </td>",
"       <td colspan=\"1\" rowspan=\"4\">",
"        Valgus force without rotation",
"       </td>",
"       <td>",
"        Localized pain, ecchymosis, swelling and stiffness",
"       </td>",
"       <td colspan=\"1\" rowspan=\"4\">",
"        Often accompanied by ACL injuries (in which case knee",
"dislocation must be considered)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Pain along course of ligament",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Laxity with valgus stress in 30 degrees of knee flexion",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Laxity with valgus stress in 0 degrees of knee flexion",
"indicates concurrent ACL injury",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"1\" rowspan=\"8\">",
"        Medial meniscal tear",
"       </td>",
"       <td colspan=\"1\" rowspan=\"8\">",
"        Twisting injury",
"       </td>",
"       <td>",
"        Usually able to ambulate, but weight bearing is limited",
"by pain",
"       </td>",
"       <td colspan=\"1\" rowspan=\"8\">",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Knee swelling and stiffness develop over 2 to 3 days",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Mechanical symptoms",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Medial pain with twisting or squatting",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Medial joint line tenderness",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Positive McMurray test",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Positive bounce home test",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Decreased range of motion",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     ACL: anterior cruciate ligament; MCL: medical collateral ligament; PCL: Posterior cruciate ligament.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
